import React, {Component} from 'react';
import { Link } from 'react-router-dom';

import '../style/header.css';

class Hi extends Component {
    state = {
        number : []
    }

    print = (list) => {
        console.log(list);
    }

    render() {
        return (
            print(this.state.number)
        );
    }
}
export default Hi;
